import React from 'react';
import { Link, Route, Router } from 'react-router-dom';
import MemoryMethod from './components/MemoryCatalogue';

export default function Home() {
  return (
    <>
    <Router>

    <div className="items-center justify-center flex pt-10">
      <Link to="/memory" >
      <Route path='/memory' element={MemoryMethod}></Route>
        <button className="bg-blue-500/80 w-20 h-8 rounded-lg">Memory</button>
      </Link>
    </div>
    </Router>
    </>
  );
}
